HRESULT CompileShaderFromFile( WCHAR* szFileName, LPCSTR szEntryPoint, LPCSTR szShaderModel, ID3DBlob** ppBlobOut )
{
    HRESULT hr = S_OK;

    DWORD dwShaderFlags = D3DCOMPILE_ENABLE_STRICTNESS;
    ID3DBlob* pErrorBlob;
    hr = D3DX11CompileFromFile( szFileName, NULL, NULL, szEntryPoint, szShaderModel, dwShaderFlags, 0, NULL, ppBlobOut, &pErrorBlob, NULL );
    if( FAILED(hr) ) {
        if( pErrorBlob != NULL ) {
            OutputDebugStringA( (char*)pErrorBlob->GetBufferPointer() );
        }
        if( pErrorBlob ) { pErrorBlob->Release(); }
        return hr;
    }
    if( pErrorBlob ) pErrorBlob->Release();

    return S_OK;
}


#define SAFE_RELEASE(v) if(v!=NULL) { v->Release(); v=NULL; }

struct RenderStateSaver
{
    ID3D11DeviceContext *m_pContext;
    D3D11_VIEWPORT m_viewport[D3D11_VIEWPORT_AND_SCISSORRECT_OBJECT_COUNT_PER_PIPELINE];
    UINT m_num_viewports;
    ID3D11VertexShader *m_pVS;
    ID3D11PixelShader *m_pPS;


    void Save()
    {
        m_pContext->RSSetViewports(m_num_viewports, m_viewport);
        m_pContext->VSGetShader(&m_pVS, NULL, NULL);
        m_pContext->PSGetShader(&m_pPS, NULL, NULL);
    }

    void Load()
    {
        m_pContext->RSGetViewports(&m_num_viewports, m_viewport);
        m_pContext->VSSetShader(m_pVS, NULL, NULL);
        m_pContext->PSSetShader(m_pPS, NULL, NULL);
    }
};



