bool CreateVertexShaderFromBytecode(ID3D11VertexShader *&pSH, const char *bytecode, size_t size_bytecode)
{
    SAFE_RELEASE(pSH);

    ID3DBlob *pBlob;
    D3DCreateBlob(size_bytecode, &pBlob);
    memcpy(pBlob->GetBufferPointer(), bytecode, size_bytecode);
    g_pDevice->CreateVertexShader(pBlob->GetBufferPointer(), pBlob->GetBufferSize(), NULL, &pSH);
    pBlob->Release();
    return true;
}

